  [],\n\t\"num_tags\": 0,\n\t\"name\": \"attributes-for-mrb-e2rf1-catchments-by-major-river-basins-in-the-conterminous-united-states-sta\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This tabular data set represents estimated
  soil variables compiled for every MRB_E2RF1 catchment of selected Major River Basins
  (MRBs, Crawford and others, 2006). The variables included are cation exchange capacity,
  percent calcium carbonate, slope, water-table depth, soil thickness, hydrologic
  soil group, soil erodibility (k-factor), permeability, average water capacity, bulk
  density, percent organic material, percent clay, percent sand, and percent silt.
  The source data set is the State Soil ( STATSGO ) Geographic Database (Wolock, 1997).
  The MRB_E2RF1 catchments are based on a modified version of the U.S. Environmental
  Protection Agency's (USEPA) ERF1_2 and include enhancements to support national
  and regional-scale surface-water quality modeling (Nolan and others, 2002; Brakebill
  and others, 2011). Data were compiled for every MRB_E2RF1 catchment for the conterminous
  United States covering New England and Mid-Atlantic (MRB1), South Atlantic-Gulf
  and Tennessee (MRB2), the Great Lakes, Ohio, Upper Mississippi, and Souris-Red-Rainy
  (MRB3), the Missouri (MRB4), the Lower Mississippi, Arkansas-White-Red, and Texas-Gulf
  (MRB5), the Rio Grande, Colorado, and the Great basin (MRB6), the Pacific Northwest
  (MRB7) river basins, and California (MRB8).\",\n\t\"owner_org\": \"bd2cdd5a-4d65-46c0-9937-c8381175f104\",\n\t\"extras\":
